defs.script:
var a4_idx;
var a4_on;
var a4_fr;
var a4_btnPauseLeft,a4_btnPlayLeft,a4_btnPauseRight,a4_btnPlayRight;
var a4_playsRight,a4_isPaused;
var a4_int;
var a4_pause,a4_playRight,a4_playLeft,a4_playBwd,a4_playFwd;
var a4_fps,a4_spd;
var a4_setFps;
var a4_seekFrame,a4_gotoNext,a4_gotoPrev;
var a4_stopFirst,a4_stopLast;
var a4_playPauseBwd,a4_playPauseFwd;
var a4_stepBwd,a4_stepFwd;
var a4_spdIncr,a4_spdDecr,a4_spdReset;
(function(){
function onload(){
if(!a4_fr){
a4_fr=new Array();
a4_on=0;
var ocg=document.getElementsByClassName('ocg');
for(var i=0;i<ocg.length;i++){
var ocgName=ocg[i].getAttribute('id').split('.');
if(ocgName[0]==4){
a4_fr[ocgName[1]]=ocg[i];
}
}
a4_btnPauseLeft=document.getElementById('4.PauseLeft');
a4_btnPlayLeft=document.getElementById('4.PlayLeft');
a4_btnPauseRight=document.getElementById('4.PauseRight');
a4_btnPlayRight=document.getElementById('4.PlayRight');
a4_playsRight=true;
a4_isPaused=false;
a4_playing=false;
a4_fps=2;
a4_spd=1;
a4_setFps=function(f){
a4_fps=(f==0?1e-6:f);
if(a4_playing){
if(a4_playsRight){a4_playRight();}else{a4_playLeft();}
}
};
a4_seekFrame=function(f){
if(f>14||f<0){return -1;}
a4_idx=f;
a4_fr[a4_on].setAttribute('visibility','hidden');
a4_fr[f].setAttribute('visibility','visible');
a4_on=f;
return 0;
};
a4_stopFirst=function(){a4_pause(true);a4_seekFrame(0);};
a4_stopLast=function(){a4_pause(true);a4_seekFrame(14);};
a4_gotoNext=function(){
if(a4_seekFrame(a4_idx+1)<0){
if(a4_playing){a4_seekFrame(a4_idx-1);a4_playLeft();}
return;
}
};
a4_gotoPrev=function(){
if(a4_seekFrame(a4_idx-1)<0){
if(a4_playing){a4_seekFrame(a4_idx+1);a4_playRight();}
return;
}
};
a4_pause=function(stop){
try{clearInterval(a4_int);}catch(e){}
a4_playing=false;
a4_isPaused=!stop;
a4_btnPauseLeft.setAttribute('visibility','hidden');
a4_btnPlayLeft.setAttribute('visibility','visible');
a4_btnPauseRight.setAttribute('visibility','hidden');
a4_btnPlayRight.setAttribute('visibility','visible');
};
a4_playRight=function(){
var tmp_int;
try{tmp_int=setInterval('a4_gotoNext()',1000/a4_fps/a4_spd);}catch(e){}
try{clearInterval(a4_int);}catch(e){}
a4_int=tmp_int;
a4_playsRight=true;
a4_playing=true;
a4_isPaused=false;
a4_btnPauseLeft.setAttribute('visibility','visible');
a4_btnPlayLeft.setAttribute('visibility','hidden');
a4_btnPauseRight.setAttribute('visibility','visible');
a4_btnPlayRight.setAttribute('visibility','hidden');
};
a4_playLeft=function(){
var tmp_int;
try{tmp_int=setInterval('a4_gotoPrev()',1000/a4_fps/a4_spd);}catch(e){}
try{clearInterval(a4_int);}catch(e){}
a4_int=tmp_int;
a4_playsRight=false;
a4_playing=true;
a4_isPaused=false;
a4_btnPauseLeft.setAttribute('visibility','visible');
a4_btnPlayLeft.setAttribute('visibility','hidden');
a4_btnPauseRight.setAttribute('visibility','visible');
a4_btnPlayRight.setAttribute('visibility','hidden');
};
a4_playPauseBwd=function(){if(a4_playing){a4_pause();}else{a4_playBwd();}};
a4_playPauseFwd=function(){if(a4_playing){a4_pause();}else{a4_playFwd();}};
a4_spdIncr=function(){a4_spd*=1.1;a4_setFps(a4_fps);};
a4_spdDecr=function(){a4_spd/=1.1;a4_setFps(a4_fps);};
a4_spdReset=function(){a4_spd=1;a4_setFps(a4_fps);};
a4_stepBwd=function(){if(!a4_playing){a4_seekFrame(a4_idx-1);a4_isPaused=true;}};
a4_stepFwd=function(){if(!a4_playing){a4_seekFrame(a4_idx+1);a4_isPaused=true;}};
a4_playBwd=function(){if(a4_idx==0||!a4_isPaused){a4_stopLast();}a4_playLeft();};
a4_playFwd=function(){if(a4_idx==14||!a4_isPaused){a4_stopFirst();}a4_playRight();};
a4_seekFrame(0);
}document.getElementById('anm4').addEventListener('mouseup',onMouseUpWdgt);
document.getElementById('anm4').addEventListener('mousedown',onMouseDownWdgt);
document.getElementById('anm4').addEventListener('touchend',onTouchEndWdgt);
document.getElementById('anm4').addEventListener('touchstart',onTouchStartWdgt);
document.getElementById('anm4').addEventListener('touchmove',onTouchMove);
onvisible();
}
function onvisible(){
}
function onhidden(){
if(a4_playing){a4_pause(true);}
if(!a4_isPaused)a4_playsRight=true;
if(!a4_isPaused&&a4_idx!=0)a4_seekFrame(0);
}
function onVisibilityChange(){
if(document.hidden){try{onhidden();}catch(e){}}else{try{onvisible();}catch(e){}}
}
document.addEventListener('visibilitychange',onVisibilityChange);
window.addEventListener('load',onload);
var permPause4=false; function onWidgetUpAction(event){
try{
if(!a4_isPaused)a4_stopFirst();
if(event.shiftKey)a4_playsRight=!a4_playsRight;
if(a4_idx==0)a4_playsRight=true;
if(a4_idx==14)a4_playsRight=false;
if(a4_playsRight){a4_playRight();}else{a4_playLeft();}
}catch(e){}
}
function onTouchStartWdgt(event){
event.preventDefault();
event.stopPropagation();
permPause4=false; try{if(a4_playing){a4_pause();}}catch(e){}
}
function onTouchEndWdgt(event){
event.preventDefault();
event.stopPropagation();
if(event.targetTouches.length>0){permPause4=true;}
else{
if(permPause4){permPause4=false;}
else{onWidgetUpAction(event);}
}
}
function onTouchMove(event){
event.preventDefault();
event.stopPropagation();
}
function onMouseDownWdgt(event){
event.preventDefault();
event.stopPropagation();
try{if(a4_playing){a4_pause();}}catch(e){}
}
function onMouseUpWdgt(event){
event.preventDefault();
event.stopPropagation();
onWidgetUpAction(event);
}
})();
